class Solution:
    def count_sequences(self, a: List[int], N: int) -> int:
        MOD = 1000000007

        def dfs(index, depth, current, res):
            if depth == N:
                res.append(current)
                return
            for i in range(index, len(a)):
                if current == current[:i] or current == current[-i-1:]:
                    continue
                for j in range(i, len(a)):
                    if i == j:
                        continue
                    if a[i] > a[j]:
                        current += (a[i], a[j])
                        dfs(j, depth+1, current, res)
                        current = current[:-2]
                    else:
                        current += (a[j], a[i])
                        dfs(i, depth+1, current, res)
                        current = current[:-2]

        res = []
        dfs(0, 0, "", res)
        return len(res) % MOD

